insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '한화꿈에그린아파트 24평 부분 리모델링: 경제적 필림 리폼 인테리어', '오늘은 저번 시간에 소개해 드린 래미안 위례 주방 인테리어에 대해 소개하는 시간을 가져보려 합니다!주방은 집에서 중요한 공간 중 하나로 클라이언트 라이프 스타일과 모임의 중심이 되는 공간입니다. 그렇기 때문에 인테리어에 있어 주방 인테리어에는 다른 공간에 비해 좀 더 신경 써 인테리어 설계를 진행하고 있어요~ 가족분들의 삶의 질을 향상시키면서 더욱 즐거운 시간을 만들어 줄 주방 디자인과 팁, 트렌드에 대해 소개해 드리겠습니다!', '아이바라', systimestamp, 0, '5101');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '고촌읍 등촌청구 31평 아파트 인테리어: KCC 샷시 교체 및 확장공사', '1990년12월에 입주한 23년 810세대 아파트입니다. 31평형 침실3개,거실,주방,욕실2개소,현관,앞뒤발코니, 화이트그레이아파트인테리어.  31평 아파트 전체 리모델링입니다. 화이트와 그레이의 모던하고 심플한 컨셉으로 유행을 타지 않는 고객님들께서 선호하시는 연출입니다. KCC샷시교체공사, 거실확장공사와 현관공간분리공사로 공간의 확장성과 효율성을 높이고 단열공사를 진행하여 기존의 곰팡이제거와 내구성을 강화하였습니다.거실과 주방을 포세린타일시공으로 고급스러움을 침실은 KCC장판시공으로,거실아트월에 디자인월판넬시공으로 밋밋한 공간을 멋을 더해주고, 주방은 약간의 구조변경을 하여 ㄱ자씽크대와 아일랜드식탁구성으로 효율적인 공간으로 욕실은 화이트와 그레이컬러의 조화로 청결한 욕실로,전체 LED조명과 매입조명시공으로 공간에 화사함을 더했습니다.철저한준비와 정확한 시공으로 마감지어 고객님의 만족도를 높였습니다.', '아이바라', systimestamp, 0, '5101');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '풍년마을2단지신일아파트 34평 인테리어: 화이트 톤의 폴딩 도어 셋트 설치', '오늘 시공 사례는 출장 메이크업을 주로 하시는 고객님의 메이크업 작업실 전체 리모델링 현장입니다. 고객님은 기존에 타 업체에서 인테리어를 했을 때 하자가 많이 발생하여 불만족한 경험을 하신 상태였습니다. 그래서 이번에는 더 신중하게 비교 후 저희를 선택하셨다고 하는데요. 감사하게도 매우 만족해주셨습니다. 지인 소개와 개인 블로그에 정성스러운 후기 포스팅 감사합니다~ 05년식 복층형 원룸 구축 오피스텔이 전체 리모델링으로 어떻게 탈바꿈했는지 함께 보실까요?', '아이바라', systimestamp, 0, '5101');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '미니멀한 무드와 따뜻함으로 가득한 신혼부부의 김포시 인테리어', '오늘 소개해 드릴 현장은 강서구 내발산동 수명산 파크 4단지, 33평형 부분 리모델링 현장이에요. 오늘 현장은 08년식 구축 아파트였어요. 구축이었지만 전 주인분께서 전체 리모델링을 진행하셔서 발코니 확장도 이미 되어있고 상태도 나쁘지 않은 공간이었습니다.깔끔한 화이트톤을 원하신 고객님의 니즈에 따라 웜화이트 & 우드 인테리어로 꾸며진 오늘의 집! 함께 출발해 볼까요?', '아이바라', systimestamp, 0, '5101');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '신도림 대림1,2차 24평 아파트: 실용적인 미니멀 인테리어', '86년에 지어진 아주 오래된 아파트이지만 기존에 있던 주방 발코니 공간을 허물고주방과 합치면서 좀 더 공간을 효율적으로 사용할 수 있도록 계획했던 현장입니다.집한가운데 공간에 발코니가 자리잡은 느낌의 집이었어서 주방도 너무 좁아 보이고내부 모습도 너무 답답한 모습이었지만 고객님이 원하시는 스타일도 명확하셨고 비슷한 사례의 사진을 구해서 전달해주셔서 마감까지 무리없이 공사를 진행했던 것 같습니다.', '아이바라', systimestamp, 0, '5101');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '가양2단지 성지아파트: 모노톤의 간결한 32평 화이트 인테리어', '오늘 보여드릴 현장은 현대아파트 24평형이에요. 89년식 구축 아파트이지만, 문틀과 중문, 폴딩도어 등 살릴 수 있는 부분은 최대한 살리고 필름 리폼 위주로 시공한 부분 리모델링 현장입니다.', '아이바라', systimestamp, 0, '5101');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '등촌동 등촌 아이파크 32평 아파트: 밝고 간결한 화이트 인테리어', '클라이언트의 라이프스타일을 고려해 집의 동선을 설계하고,가장 살기 좋은 집을 완성합니다. 20평대 작은 주방에 냉장고 수납과 세탁실 사용이편리한 집으로 설계된 가양강변3단지 20평의 before & after 시공 사례를 소개합니다~', '에이치디자인', systimestamp, 0, '5102');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '경제적 리모델링과 현대적 감성이 어우러진 인천 계양구 박촌동 아파트', '집의 구조와 동선 & 라이프 스타일에 꼭 맞는 " 맞춤 제작 가구"와 오프 화이트 중심의정갈함이 돋보이는 모던한 디자인으로 완성한 두산위브2단지 24평', '에이치디자인', systimestamp, 0, '5102');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '김포시 고촌읍 등촌청구 아파트: 작은방 및 현관 확장 공사', '이번 현장은 신혼부부 고객님이 거주하실 공간인데요~공간이 전체적으로 너무 따스하고 귀엽게 디자인 되었습니다~저희 디자인파란은 신혼부부 고객님의 로망을 실현시키기 위해고객님과 많은 대화를 통해 원하시는 디자인과 라이프스타일을 파악하여실용적이면서도 아름다운 공간을 완성시켜드렸답니다. 지금부터 같이 갈산한국아파트 31평 인테리어 보러가실까요??', '에이치디자인', systimestamp, 0, '5102');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '풍년마을2단지신일아파트: 신샷시 교체와 화이트 인테리어의 만남', '오늘 만나볼 현장은 수명산파크 7단지 33평 인테리어입니다.7단지는 2008년도에 준공된 나름 신식 아파트로전체 톤 체인지에 중점을 맞춰 공사되었는데요~고객님께서 가구와 오브제, 소품들로 포인트 줄예정이었기에 군더더기 없는 깔끔한 바탕을 만들어만족할 수 있는 휴식공간을 선물해 드렸습니다 :)', '에이치디자인', systimestamp, 0, '5102');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '신도림 대림1,2차 24평 아파트: 신혼 부부의 감각적 미니멀 인테리어', '오늘은 저번 시간에 소개해 드린 래미안 위례 주방 인테리어에 대해 소개하는 시간을 가져보려 합니다!주방은 집에서 중요한 공간 중 하나로 클라이언트 라이프 스타일과 모임의 중심이 되는 공간입니다. 그렇기 때문에 인테리어에 있어 주방 인테리어에는 다른 공간에 비해 좀 더 신경 써 인테리어 설계를 진행하고 있어요~ 가족분들의 삶의 질을 향상시키면서 더욱 즐거운 시간을 만들어 줄 주방 디자인과 팁, 트렌드에 대해 소개해 드리겠습니다!', '에이치디자인', systimestamp, 0, '5102');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '가양2단지 성지아파트: 모노톤의 심플한 화이트 인테리어 디자인', '32년된 현장으로 보관이사 리모델링이 진행된 현장 입니다. 고객님께서 고민이 많으셨는데요, 현장미팅과 사무실상담으로 두달전부터 예약을 하셔서 충분한 시간을 두고 거주하면서 불편했던 점과 개선할점들을 선택하셨습니다. 30평의 공간을 충분히 활용한 특히 공간별 수납을 강화하여 정리정돈이 강화된 리모델링으로 거실윌플릭스,거실코너수납장,작은방윌플랙스,안방붙박이장,현관수납장,발코니수납장등이 시공되고 전체 샷시교체공사와 현관중문 공사로 공간위 내구성을 강화하고 작은방확장공사와 부분별 단열공사로 공간의 효율성과 내구성을 높였습니다.주방 또한 ㄱ자형태의 씽크대와 김치냉자고장,키큰장,냉장고장2대 등으로 수납을 충분히 할수 있는 리모델링으로 욕실은 모던한 톤온톤의 그레이 욕실리모델링으로 전체  화이트베이스에 그레이컬러가 포인트로 시공되어 심플하고 모던하게 연출되었습니다.', '에이치디자인', systimestamp, 0, '5102');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '등촌 아이파크 32평 아파트: 화이트 톤의 밝고 깔끔한 인테리어', ' 이번 시간에 소개해 드릴 현장은 경기도 성남시에 소재한 래미안 위례 거실 인테리어에요. 래미안 위례의 경우 여러분들께 공간별로 소개해 드리려 합니다~ 래미안 위례 거실을 한마디로 표현한다면 여유로움 속 트렌디함이라 표현할 수 있겠네요!', '모넬로인테리어', systimestamp, 0, '5103');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '경제적이면서도 세련된 변화를 이끄는 김포시 고촌읍 등촌청구 아파트', '화이트와 그레이의 모던하고 심플한 컨셉으로 유행을 타지 않는 고객님들께서 선호하시는 연출입니다. KCC샷시교체공사, 거실확장공사와 현관공간분리공사로 공간의 확장성과 효율성을 높이고 단열공사를 진행하여 기존의 곰팡이제거와 내구성을 강화하였습니다.거실과 주방을 포세린타일시공으로 고급스러움을 침실은 KCC장판시공으로,거실아트월에 디자인월판넬시공으로 밋밋한 공간을 멋을 더해주고, 주방은 약간의 구조변경을 하여 ㄱ자씽크대와 아일랜드식탁구성으로 효율적인 공간으로 욕실은 화이트와 그레이컬러의 조화로 청결한 욕실로,전체 LED조명과 매입조명시공으로 공간에 화사함을 더했습니다.철저한준비와 정확한 시공으로 마감지어 고객님의 만족도를 높였습니다.', '모넬로인테리어', systimestamp, 0, '5103');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '풍년마을2단지신일아파트: 화이트 톤의 심플한 폴딩 도어 인테리어', '대림 1,2차 아파트 입니다. 저희가 맡게 된 현장은 24평 크기의 2베이 구조를 지닌 구축 아파트 입니다.신혼부부께서 거주하실 곳으로 좀 더 넓은 생활 공간이 필요했기에 거실과 방의 발코니를 확장해 공간을 더 효율적으로 설계할 수 있었던 것 같습니다.', '모넬로인테리어', systimestamp, 0, '5103');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '신도림 대림1,2차 24평 아파트: 미니멀한 무드와 따뜻한 분위기의 인테리어', '요즘은 아파트매매현장도 있지만 보관이사리모델링 문의가 많으신데요, 기존의 살림살이를 정리정돈하고 오래되고 낡은것들을 정리하는 과정으로 생각하시면 될거 같아요. 또 오래 거주하셨던 공간이라 무엇을 고치고 재활용할지 결정하기가 수월하죠. 살면서 불편했던 부분들을 보완할수 있는 장점이 있습니다. 전체 샷시교체공사,거실확장,주방확장,작은방확장,단열공사등 공간의 내구성과 확장성을 확보하는 중요한 공사가 진행되고 침실3개 공간에 공간별 붙박이장이 시공되어 수납을 강화하였습니다. 확장공사로 넓어진 거실공간은 TV아트월 목공사로 심플하게,주방은 ㄱ자씽크대와 키큰수납장시공,욕실은 전체리모델링으로 톤온톤의 그레이컬러로 모던하게,현관은 파티션과 신발장띄움시공과 낮은 수납장을 시공하여 공간의 효율성을 높였습니다.', '모넬로인테리어', systimestamp, 0, '5103');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '가양2단지 성지아파트: 강서구의 심플하고 세련된 모노톤 인테리어', '욕실공사: 거실욕실,안방욕실
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '등촌 아이파크 32평 아파트: 밝고 간결한 화이트 톤의 인테리어 변화', '오늘 포스팅에서 소개해 드릴 인테리어 시공 현장은 22평형 아파트입니다.이번 시공 현장은 전체적인 변화보다는 특정 공간에 초점을 맞춘 부분 리모델링으로 진행되었습니다.', '에스엘디자인', systimestamp, 0, '5104');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '경제적이면서도 세련된 변화를 이루는 고촌읍 등촌청구 31평 아파트', '이번에 소개해 드릴 시공 사례는 짙은 우드 마감재들을 걷어낸 후에 화이트 톤을 베이스로 선명하고 깨끗한 미니멀 인테리어로 지향해 꾸며질 수 있었던 현장이었는데요. 기존 주방 가벽 철거 시공과 함께 특히 단열, 방수에 신경 써 공사가 진행되었습니다 :D 49평형 구옥 아파트 인테리어 현장으로 넓은 공간이 미니멀 스타일로 어떻게 연출되었는지 지금부터 자세히 공간별로 소개해 드릴 테니 집중 부탁드립니다 :)', '에스엘디자인', systimestamp, 0, '5104');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '폴딩 도어 셋트와 화이트 톤의 현대적 인테리어', '이번에는 감성이 살아 숨 쉬는 거실 공간에 대한 리모델링을 소개해 드립니다. 거실은 가족의 추억이 모이는 장소이자, 각자의 개성이 반영되는 쉼터입니다. 그래서 우리는 클라이언트의 취향을 세심하게 반영하여, 모두가 편안함을 느낄 수 있는 공간을 창조합니다. 오늘은 현대적이면서도 따뜻한 느낌을 주는 거실 디자인과 함께, 효율적인 공간 활용 팁을 알려드릴 예정이에요!', '에스엘디자인', systimestamp, 0, '5104');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '자연과 어우러진 현대적 도시 인테리어', '이번에는 신혼부부를 위한 아늑한 침실 인테리어를 진행했던 현장을 소개해 드리려고 해요. 침실은 개인의 휴식을 취하는 곳으로 그 어떤 공간보다 개인의 선호가 중요하게 작용하는데요, 우리는 두 분의 로맨틱하고 평화로운 분위기를 연출하기 위해 부드러운 색감과 섬세한 조명을 활용한 디자인을 제안했습니다. 침실 공간이 어떻게 변신했는지 지켜봐 주세요.', '에스엘디자인', systimestamp, 0, '5104');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '도심 속의 아늑한 공간으로 변화하는 인테리어', '이번 포스트에서는 아이들을 위한 맞춤형 키즈룸 인테리어를 다뤄볼까 합니다. 아이들의 상상력과 창의력이 자라나는 곳, 바로 키즈룸이죠. 안전은 물론, 재미와 교육적 요소를 접목한 디자인으로 아이들이 매일 즐거운 모험을 할 수 있는 공간을 만들어냈습니다. 벽화, 다기능 수납장, 그리고 학습 공간까지, 아이들이 꿈꿀 수 있는 모든 것을 키즈룸에 담았어요!', '에스엘디자인', systimestamp, 0, '5104');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '현대적 디자인과 기능성을 갖춘 구로구 아파트 인테리어', '오늘은 전원주택의 아름다운 서재 공간 인테리어를 공유하려 합니다. 서재는 조용하고 창의적인 생각이 필요한 공간이죠. 우리는 자연광을 최대한 활용하고, 나무의 따스함을 느낄 수 있는 내추럴한 소재를 사용해, 책과 함께 시간을 보내는 평화로움을 극대화했습니다. 휴식과 사색이 공존하는 서재 인테리어, 함께 살펴보시죠.', '꾸미다인', systimestamp, 0, '5105');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '강서구의 신선한 공기를 담은 창방 인테리어', '이번에는 작은 평수 아파트의 활용도를 극대화한 주방+다이닝 공간 리모델링 사례를 소개하려고 해요. 공간이 작다고 포기할 필요 없이, 우리는 스마트한 수납 해결책과 더불어 식사와 요리가 동시에 이루어질 수 있는 멀티펑셔널 공간을 설계했습니다. 주방과 식탁이 조화롭게 어우러져, 가족 모두가 즐겁게 요리하고 식사를 할 수 있는 분위기를 조성했죠. 이 작은 공간의 대변신, 놓치지 마세요!', '꾸미다인', systimestamp, 0, '5105');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '노원구의 평온한 분위기를 반영한 실용적 인테리어', '지금부터 소개할 것은 현대적인 감각이 돋보이는 욕실 리모델링입니다. 욕실은 개인의 취향을 반영하는 동시에, 청결하고 기능적인 공간이어야 합니다. 저희는 클라이언트의 스타일을 반영해 최신 트렌드를 접목한 세련된 욕실을 제작했어요. 혁신적인 수납 솔루션과 세련된 타일 조합으로, 일상의 목욕 시간을 특별한 휴식의 시간으로 변모시켰습니다.', '꾸미다인', systimestamp, 0, '5105');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '관악산을 닮은 푸른 녹지와 어우러진 인테리어', ' 이번에는 현대적 감각이 돋보이는 용산 파크뷰의 거실을 재해석한 인테리어 프로젝트를 선보일 예정입니다. 거실은 가정의 얼굴이자 휴식과 소통의 장으로서 그 가치가 더욱 중요해지고 있는데요, 우리는 클라이언트가 꿈꾸는 이상적인 거실 공간을 실현하기 위해 맞춤형 디자인을 제공합니다. 쾌적한 분위기 조성은 물론, 현대적인 가구 배치와 공간 활용의 팁을 통해, 가족 모두가 만족할 수 있는 거실 공간을 만들어 드리겠습니다!', '꾸미다인', systimestamp, 0, '5105');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '일산의 현대적인 도시 라이프를 위한 인테리어', '고객님의 일상에 꼭 맞는 개성 있는 주거 공간을 제공합니다. 이번에는 트렌디한 감각이 돋보이는 명동 스카이 레지던스의 침실 인테리어를 소개해드리려 합니다. 침실은 개인의 휴식과 재충전을 위한 공간으로, 디자인과 기능성이 조화를 이루어야 하는 중요한 장소입니다. 맞춤형 수납장 설계로 깔끔함을 유지하면서도, 세련된 침실 디자인으로 여러분의 퀄리티 있는 삶을 지원하겠습니다. 컬러 매치부터 소품 선정까지, 디테일에 이르기까지 우리는 여러분의 침실이 단순한 잠자리가 아닌, 삶의 질을 높이는 공간이 되도록 만들어 갑니다!', '꾸미다인', systimestamp, 0, '5105');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '종로의 전통과 현대적 감각이 어우러진 고급스러운 인테리어', '고객님의 이야기가 담긴 생활 공간을 만드는 데 집중합니다. 오늘은 근사한 강남 엘리트 하우스의 아이 방 리모델링 프로젝트를 공개합니다. 아이 방은 아이의 성장은 물론, 학습과 놀이가 함께하는 다용도 공간으로 기능해야 합니다. 우리는 고객님의 아이가 즐겁고 건강하게 자랄 수 있는 환경을 만들기 위해 안전한 재료 선택과 창의적인 공간 배치를 추구합니다. 학습 효율을 높여주는 책상 배치부터, 재미있는 놀이 공간까지, 아이의 성장 과정에 맞춘 인테리어로 가득 채울 것입니다!', '하얀집인테리어', systimestamp, 0, '5106');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '고양시 덕양구의 자연과 어우러진 실내공간', '오늘은 특별히 세련된 도시적 감성을 담은 한남동 레지던스의 거실 인테리어를 소개해 드릴 예정입니다. 이 공간은 도심 속 현대적 생활을 반영해 모더니티와 편안함을 조화롭게 담아내고자 했습니다. 집안 곳곳에 세심하게 배치된 아트워크와 함께, 휴식과 대화가 어우러지는 거실 공간을 만들어 더욱 의미 있는 시간을 보낼 수 있도록 설계했습니다.', '하얀집인테리어', systimestamp, 0, '5106');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '강변의 멋진 전망을 갖춘 영등포구 아파트 인테리어', '이번에는 자연 채광을 극대화한 서초동 펜트하우스의 침실 인테리어를 보여드릴 것입니다. 이 공간은 대형 창문을 통해 들어오는 햇빛을 이용해 여유로운 아침을 맞이하실 수 있도록 디자인되었습니다. 우드 소재와 화이트 컬러를 기반으로 한 인테리어가 포근하고 안정된 수면을 도와드릴 거예요.', '하얀집인테리어', systimestamp, 0, '5106');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '안양시 동안구의 모던한 라이프 스타일을 반영한 인테리어', '오늘은 현대와 전통이 공존하는 분위기를 연출한 북촌 한옥의 다락방 인테리어를 선보이고자 합니다. 전통적인 요소를 현대적 감각으로 재해석하여, 전통의 멋과 현대적 편의성이 어우러진 고유의 공간을 만들어냈습니다. 목재와 한지를 사용한 인테리어로 고즈넉한 분위기 속에서 여유를 만끽하실 수 있습니다.', '하얀집인테리어', systimestamp, 0, '5106');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '양천구의 푸르른 자연과 어우러진 인테리어 디자인', '오늘은 활기찬 색채가 돋보이는 강남 스타일리스트 살롱의 내부 인테리어를 소개해 드립니다. 이곳은 고객님의 에너지와 창의력이 샘솟도록 활기찬 색상과 패턴으로 가득 차 있습니다.', '하얀집인테리어', systimestamp, 0, '5106');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '자연친화적이고 실용적인 집 인테리어', '도심 한복판에서 자연과 어우러지는 휴식을 취할 수 있는 거실 인테리어를 소개해 드리고자 합니다. 우리는 집안에 식물을 풍성하게 배치하고, 자연 소재를 사용하여 공간에 생명을 불어넣었습니다. 햇빛이 잘 들어오는 창가에는 작은 허브 정원을 마련하여 신선함을 느낄 수 있도록 했죠. 자연스러운 컬러 팔레트와 목재의 따뜻함이 조화를 이루는 이 거실은 마치 숲속의 캐빈에 있는 듯한 평화로움을 선사합니다.', '미소디자인', systimestamp, 0, '5107');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '현대적이고 아늑한 광명시 아파트 인테리어', '최근 재택근무가 일상이 된 만큼, 집에서도 업무에 집중할 수 있는 공간이 필수가 되었죠. 오늘은 고객님의 업무 효율성을 극대화하기 위해 디자인한 미니멀리즘 홈 오피스를 공유하려 합니다. 흰색과 검정색의 대조적인 컬러 스킴을 사용하여 집중을 방해하는 요소를 최소화했습니다. 또한, 맞춤형 책상과 수납장을 통해 최대한의 수납 공간을 확보하면서도 깔끔한 라인을 유지했습니다. 단순하지만 강력한 이 공간은 효율적인 작업환경을 만드는 데 중점을 두었습니다.', '미소디자인', systimestamp, 0, '5107');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '구로구의 현대적인 도시 라이프를 반영한 인테리어', '오늘은 특별히 연인들을 위한 로맨틱한 침실 인테리어를 소개해 드립니다. 부드러운 조명, 따스한 패브릭, 그리고 섬세한 장식으로 이루어진 이 침실은 두 사람만의 달콤한 공간이 되도록 설계되었습니다. 벽면 하나를 선택하여 사진과 추억이 담긴 갤러리 벽을 만들고, 부드러운 커튼과 침구로 아늑함을 더했습니다. 이곳은 일상에서 벗어나 서로를 위한 시간을 만끽할 수 있는 완벽한 공간입니다.', '미소디자인', systimestamp, 0, '5107');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '강서구의 자연과 어우러진 편안한 인테리어 공간', '오늘은 기능성과 스타일이 조화를 이룬 현대적인 주방 리모델링 사례를 보여드립니다. 고객님의 요리 활동을 고려하여 실용적인 구조의 주방을 설계하였고, 최신 가전제품을 통합하여 현대적인 편의성을 더했습니다. 세련된 메탈릭 터치와 모던한 캐비닛 디자인으로 깔끔하면서도 풍부한 저장 공간을 제공합니다. 이 주방은 모임의 중심지가 될 것이며 가족 간의 소통을 더욱 풍부하게 해줄 것입니다.', '미소디자인', systimestamp, 0, '5107');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '노원구의 평화로운 분위기를 담은 아늑한 인테리어', '책을 사랑하는 고객님을 위해 아늑한 북 카페 스타일의 서재를 조성했습니다. 따뜻한 목재 책장과 소프트한 조명은 독서에 최적화된 환경을 제공하며, 편안한 암체어는 긴 시간 독서에도 편안함을 줍니다. 여러분의 좋아하는 커피 한 잔과 함께 책 속 세계로 빠져볼 수 있는 이 공간은 일상에서 벗어나 마음의 여유를 즐길 수 있는 특별한 곳입니다.', '미소디자인', systimestamp, 0, '5107');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '관악구의 자연 친화적이고 세련된 인테리어', '여러분의 삶에 휴식과 상쾌함을 더하는 욕실 디자인을 제안합니다. 우리는 편리함과 휴식이 공존하는 욕실 공간을 만들기 위해 현대적인 설비와 세련된 소재를 선택했습니다. 넉넉한 수납공간과 함께, 깔끔한 라인의 샤워 부스와 목욕탕을 설계하여 사용자의 편의를 최우선으로 생각했습니다. 밝은 컬러와 현대적인 질감이 조화를 이루어, 매일의 시작과 끝을 기분 좋게 할 수 있는 공간을 선사합니다.', '더레드인테리어', systimestamp, 0, '5108');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '일산의 고급스러운 도시 라이프를 반영한 인테리어', '오늘은 즐겁고 활기찬 파스텔 톤의 키즈룸을 선보입니다. 안전하고 친환경적인 소재로 아이들의 상상력을 자극하는 다채로운 디자인을 구현했습니다. 벽면에는 교육적이면서 재미있는 벽화를 그려 넣어 아이들이 즐겁게 배울 수 있는 공간을 만들었고, 키즈 가구는 사용성과 안전을 고려하여 선택했습니다. 이 공간은 아이들에게 창의력을 키우는 놀이터이자 학습 공간으로 변신합니다.', '더레드인테리어', systimestamp, 0, '5108');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '종로의 전통과 현대적 감각이 조화로운 고급 인테리어', '다이닝 룸은 단순히 식사를 하는 장소 이상의 의미를 가져야 합니다. 저희는 이번 프로젝트에서 현대적이고 심플한 디자인을 통해 다이닝 룸을 완전히 새롭게 탈바꿈시켰습니다. 세련된 테이블과 편안한 좌석이 조화를 이루며, 조명은 식사 분위기를 더욱 돋보이게 합니다. 이곳에서 가족들과 함께하는 식사 시간은 더욱 기억에 남는 순간이 될 것입니다.', '더레드인테리어', systimestamp, 0, '5108');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '현대적인 주거 공간: 작지만 효율적인 집 구조 디자인', '오늘은 빈티지한 매력과 현대적 감각이 어우러진 거실 리노베이션 사례를 소개합니다. 과거의 아름다움을 간직한 빈티지 가구와 모던한 소품들이 조화를 이루어 고유의 스타일을 창출합니다. 원목 바닥과 앤티크 장식품은 클래식한 멋을, 현대적인 소파와 테이블은 사용자의 편리성을 더해주죠. 이러한 조화로운 디자인은 거실을 더욱 독특하고 개성 있는 공간으로 만들어줍니다.', '더레드인테리어', systimestamp, 0, '5108');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '생활 편의성을 높이는 작은집 주방 확장 프로젝트', '은퇴 후 여유로운 삶을 꿈꾸시는 분들을 위한 안락한 리빙룸 디자인을 선사합니다. 우리는 취미와 휴식을 모두 즐길 수 있는 공간을 마련하여 고객님의 라이프스타일에 맞춰 진정한 휴식처를 제공합니다. 부드러운 색상의 소파와 리클라이너, 여유로운 독서 공간과 함께 음악을 감상할 수 있는 공간을 설계했습니다. 이 공간은 여러분의 새로운 취미를 발견하고, 일상의 여유를 만끽하는 곳이 될 것입니다.', '더레드인테리어', systimestamp, 0, '5108');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '쾌적한 환경을 위한 라인 조명과 시스템 에어컨', '마음의 평화를 찾을 수 있는 특별한 공간을 조성했습니다. 바쁜 일상에서 벗어나 명상과 요가를 즐길 수 있는 공간을 만들어, 고객님의 정신적, 신체적 웰빙을 지원합니다. 자연광이 가득한 방에는 부드러운 쿠션과 마음을 진정시키는 색상들로 꾸며져 있으며, 모든 요소들이 조화를 이루어 최상의 평온을 선사합니다.', '바넘디자인', systimestamp, 0, '5109');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '낭만적인 분위기와 휴식 공간이 조화를 이루는 주택', '이번에는 스칸디나비아 디자인에서 영감을 받아, 깨끗하고 심플한 선들이 돋보이는 주방을 완성했습니다. 밝은 목재 바닥과 화이트 캐비닛, 그리고 세련된 스테인리스 스틸 조리기구가 모던함을 더해주며, 여유로운 아침 식사를 즐길 수 있는 작은 아일랜드도 설계했습니다.', '바넘디자인', systimestamp, 0, '5109');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '오래된 주택의 새로운 모습: 환골탈태 리모델링 프로젝트', '밝고 활기찬 색상들과 장난기 넘치는 벽화로 아이들이 마음껏 뛰어놀 수 있는 공간을 만들었습니다. 맞춤 제작된 다기능 놀이 가구는 안전하고 즐거운 놀이 환경을 제공합니다.', '바넘디자인', systimestamp, 0, '5109');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '독특한 디자인과 공간 활용력을 가진 30평 라운드 포인트 인테리어', '이번에는 실외 공간을 활용하여 편안한 야외 테라스와 아름다운 정원을 조성했습니다. 향기로운 꽃들과 푸른 식물들로 둘러싸인 이곳은 친구들과의 바비큐 파티나 조용한 독서 시간을 즐기기에 완벽한 공간입니다.', '바넘디자인', systimestamp, 0, '5109');
insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '작은 공간, 큰 아이디어: 20평대 작은집의 모던한 변신', '중세 유럽 스타일의 식당 디자인입니다. 묵직한 목재 가구와 고딕 양식의 장식품으로 우아함과 클래식한 매력을 강조했습니다. 이 공간은 마치 중세의 성에 온 것 같은 느낌을 주며, 식사 시간을 특별한 경험으로 만들어줍니다.', '바넘디자인', systimestamp, 0, '5109');
