insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '낭만적인 침실 만들기: 드림 캐쳐와 함께', ' 이번 시간에 소개해 드릴 현장은 경기도 성남시에 소재한 래미안 위례 거실 인테리어에요. 
