insert into biz_cases(BC_NO,BC_TITLE,BC_CONTENT,BC_WRITER,BC_DATE,BC_HIT,INTENO) values(biz_cases_seq.nextval, '홈 짐 설치하기: 건강을 위한 개인 운동 공간', '대림 1,2차 아파트 입니다. 저희가 맡게 된 현장은 24평 크기의 2베이 구조를 지닌 구축 아파트 입니다.
